st/adm/adm-v2/dist/public/themes/wordplate/images/thumb-coworker-02.png\" /><div class=\"CoworkersPatchwork_description\"><div class=\"CoworkersPatchwork_descriptionContent\"><div class=\"CoworkersPatchwork_name\">Mylène Coucou</div><div class=\"CoworkersPatchwork_activity\">touriste</div></div></div></a></li></ul></div></div><div class=\"AdmPresentation HomePage_admPresentation\"><section class=\"AdmPresentation_wrapper\"><div class=\"AdmPresentation_content\"><h1 class=\"AdmPresentation_title\">\n                Travailler à l\'atelier\n            </h1><div class=\"AdmPresentation_text\"><p>Créé en 2008, l’Atelier des Médias est le 1er espace de coworking lyonnais. C’est une association qui regroupe des professionnels des médias (journalisme, web, graphisme, traduction, vidéo/photo, etc.), un vivier de compétences qui collabore et invente de nouveaux modes de travail dans ce lieu de 212 m2 en centre ville.</p></div></div></section></div><div class=\"AdherentSection HomePage_adherentSection\"><div class=\"AdherentSection_content\"><div class=\"AdherentBlock AdherentBlock-adherent AdherentSection_adherentBlock\"><div class=\"AdherentBlock_wrapper\"><header class=\"AdherentBlock_header\"><h1 class=\"AdherentBlock_title\"><div class=\"AdherentBlock_verb\">devenir</div><div class=\"AdherentBlock_calificatif\">adherent</div></h1></header><section class=\"AdherentBlock_content\"><div class=\"AdherentBlock_description\">Devenir adhérent de l\'association est ouvert à tous et permet de :</div><div class=\"AdherentBlock_text\"><ul><li>Recevoir des invitations à tous les évènements de l&rsquo;association</li><li>participer aux assemblées générales</li><li>Avoir la possibilité de se présenter aux élections du CA</li></ul></div><div class=\"AdherentBlock_priceBlock\"><div class=\"AdherentBlock_price\">15 €</div><div class=\"AdherentBlock_labelPrice\">TTC/an</div></div></section></div></div><div class=\"AdherentSection_inlineWrapper\"><div class=\"AdherentBlock AdherentBlock-fixe AdherentSection_adherentBlock\"><div class=\"AdherentBlock_wrapper\"><header class=\"AdherentBlock_header\"><h1 class=\"AdherentBlock_title\"><div class=\"AdherentBlock_verb\">formule</div><div class=\"AdherentBlock_calificatif\">fixe</div></h1></header><section class=\"AdherentBlock_content\"><div class=\"AdherentBlock_text\"><ul><li>Un bureau fixe en open space</li><li>Petits rangements ouverts</li><li>Un badge d&rsquo;accès 24h/24 et 7j/7</li><li>Règlement mensuel par prélèvement automatique</li><li>2 mois de préavis</li></ul></div><div class=\"AdherentBlock_priceBlock\"><div class=\"AdherentBlock_price\">168 €</div><div class=\"AdherentBlock_labelPrice\">TTC/mois</div></div><div class=\"AdherentBlock_note\">* sous condition de s\'être acquité de l\'hadésion annuelle de 15 €</div></section></div></div><div class=\"AdherentBlock AdherentBlock-nomade AdherentSection_adherentBlock\"><div class=\"AdherentBlock_wrapper\"><header class=\"AdherentBlock_header\"><h1 class=\"AdherentBlock_title\"><div class=\"AdherentBlock_verb\">formule</div><div class=\"AdherentBlock_calificatif\">nomade</div></h1></header><section class=\"AdherentBlock_content\"><div class=\"AdherentBlock_text\"><ul><li>Un bureau sans place attitrée</li><li>Un casier personnel</li><li>Un badge d&rsquo;accès 24h/24 et 7j/7</li><li>Règlement mensuel par prélèvement automatique</li><li>2 mois de préavis</li></ul></div><div class=\"AdherentBlock_priceBlock\"><div class=\"AdherentBlock_price\">96 €</div><div class=\"AdherentBlock_labelPrice\">TTC/mois</div></div><div class=\"AdherentBlock_note\">* sous condition de s\'être acquité de l\'hadésion annuelle de 15 €</div></section></div></div></div></div></div><div class=\"FeaturesSection HomePage_featuresSection\"><div class=\"FeaturesSection_wrapper\"><section class=\"FeaturesSection_content\"><div class=\"FeatureBlock FeaturesSection_featureBlock\"><div class=\"FeatureBlock_content\"><div class=\"FeatureBlock_icon\"><?xml version=\"1.0\" encoding=\"UTF-8