	(63,5,'_who_are_coworkers_title','field_5ccf2347d3ef7'),
	(64,5,'who_are_coworkers_text','<div class=\"CoworkersPresentation_text\">\r\n\r\nVIA WP - Graphistes, développeurs, éditeurs, journalistes, conseils en communication, rédacteurs, traducteurs, réalisateurs, photographes, et autres inventeurs des médias d’aujourd’hui, ils sont indépendants ou télétravailleurs et offrent une expertise inégalée dans le domaine des médias et de la communication.\r\n\r\nDes professionnels qui travaillent en solo ou en équipe et s’appuient sur la force du réseau pour collaborer.\r\n\r\n</div>'),
